import React, {useState, useEffect} from 'react'
import records from './records.json';


function DataFetching() {

    <div className="post">
        {records.map(records => (
            <div key={records.id}>
                <h3>{records.title}</h3>
                <p>{records.body}</p>
            </div>
        ))}

    </div>
}
export default DataFetching
